import React, { useState } from "react";
import {Link} from "react-router-dom"; 
import { useNavigate } from "react-router-dom";
const Contact = () => {
  const navigate=useNavigate()
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    
try {
      const response = await fetch("http://localhost:5000/api/userr", {
        method: "POST",
        headers: {
          "Content-Type": "application/json"
        },
        body: JSON.stringify({name,email,password})
      });

const data=await response.json();


      if (response.ok) {
        alert("Success");
        // navigate("/contact")
      } else {
        alert("User already exists, please login");
      }
    } catch (err) {
      console.log(err);
      alert("Something went wrong.Try again.");
    }
  };

  return (
    <div style={{ width: "300px", margin: "100px auto", padding: "20px", textAlign: "center", border: "1px solid #ccc", borderRadius: "10px",backgroundColor:"orange" }}>
      <h2>Sign Up</h2>
      <form onSubmit={handleSubmit} style={{ display: "flex", flexDirection: "column" }}>
   
      <input
          type="text"
          placeholder="Enter Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
          style={{ margin: "10px 0", padding: "10px", fontSize: "16px" }}
        />

   
        <input
          type="email"
          placeholder="Enter Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
          style={{ margin: "10px 0", padding: "10px", fontSize: "16px" }}
        />
        <input
          type="password"
          placeholder="Enter Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
          style={{ margin: "10px 0", padding: "10px", fontSize: "16px" }}
        />
        <button type="submit" style={{ background: "blue", color: "white", padding: "10px", fontSize: "16px", cursor: "pointer" }}>
          Sign Up
        </button>
        <Link to="/Contact">Already have an Account<span style={{fontSize:"20px"}}>  Login</span></Link>
      </form>
    </div>
  );
};

export default Contact;
